(window.webpackJsonp=window.webpackJsonp||[]).push([[90],{311:function(e){e.exports={data:{posts:{totalCount:75,pageInfo:{totalPages:4,currentPage:2,isFirst:!1,isLast:!1},edges:[{node:{title:"At Dawn",path:"/blog/2017/08/25/at-dawn",excerpt:"<p>Who knew it was this cold at 5:30 am?</p>\n",date:"2017-08-25T00:00:00.000Z",timeToRead:2}},{node:{title:"Current (life) events",path:"/blog/2017/08/17/current-life-events",excerpt:"<p>Well, stuff is happening.</p>\n",date:"2017-08-17T00:00:00.000Z",timeToRead:1}},{node:{title:"Living in the City (you know you have to survive)",path:"/blog/2017/08/14/living-in-the-city-you-know-you-have-to-survive",excerpt:"<p>Well, my life has changed.</p>\n",date:"2017-08-14T00:00:00.000Z",timeToRead:2}},{node:{title:"New Zealand Politics 2017",path:"/blog/2017/08/02/new-zealand-politics-2017",excerpt:"<p>New Zealand doesn’t have a political system like the United States. The head of the country isn’t someone you vote for directly. Instead you vote for a political party, and the head of a particular party then becomes the countries leader – or Prime Minister.</p>\n",date:"2017-08-02T00:00:00.000Z",timeToRead:5}},{node:{title:"The Nuclear Option",path:"/blog/2017/07/27/the-nuclear-option",excerpt:"<p>Nuclear power has always been very controversial, but since the disaster in Japan at the Fukushima Daiichi power plant the topic has come under more scrutiny than ever.</p>\n",date:"2017-07-27T00:00:00.000Z",timeToRead:5}},{node:{title:"When Nice Stuff Happens",path:"/blog/2017/07/15/when-nice-stuff-happens",excerpt:"<p>Doesn’t stuff happen? Nice stuff happens. I like it when nice stuff happens.</p>\n",date:"2017-07-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Query the theoretical",path:"/blog/2017/07/11/query-the-theoretical",excerpt:"<p>This will be a bit of thinking out loud, a stream of consciousness. It won’t have the editorial quality that I’m trying to follow, but some strange force is motivating me to put this out before I sleep. It’s just turned 1 am.</p>\n",date:"2017-07-11T00:00:00.000Z",timeToRead:3}},{node:{title:"Oh What a Night?",path:"/blog/2017/06/30/oh-what-a-night",excerpt:"<p>This is the finish my friend, this is the End.</p>\n",date:"2017-06-30T00:00:00.000Z",timeToRead:1}},{node:{title:"It's Business Time",path:"/blog/2017/06/25/it-s-business-time",excerpt:"<p>In my great effort to move forward and get down to business, I got business cards printed.</p>\n",date:"2017-06-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Research report into Name of Austin",path:"/blog/2017/06/21/research-report-into-name-of-austin",excerpt:'<h3 id="what-is-austin"><a href="#what-is-austin" aria-hidden="true"><span class="icon icon-link"></span></a>What is Austin?</h3>\n',date:"2017-06-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I have, I want",path:"/blog/2017/06/16/i-have-i-want",excerpt:"<p>First, I built a splash page profile to help expand my reach as I go into this new world of freelance, casual employment.</p>\n",date:"2017-06-16T00:00:00.000Z",timeToRead:2}},{node:{title:"Public Spoken",path:"/blog/2017/06/15/public-spoken",excerpt:'<p>I did a presentation with the <a href="https://humanist.nz/" target="_blank" rel="nofollow noopener noreferrer">Humanist Society of New Zealand</a>. About 20 people attended, all in a meeting room above a pub in the middle of the city. I’d say it went well, although I’m sure from an outside perspective I was awkwardly squeezing words out of my mouth.</p>\n',date:"2017-06-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Strange",path:"/blog/2017/06/07/strange",excerpt:"<p>This is the first time in about 12 years that I haven’t been keeping in the loop around E3. Right now I’m playing through the new Shovel Knight expansion and enjoying the mechanics. I still have a stack of Wii U games to get through including Xenoblade Chronicles X, Twilight Princess HD and Kirby and the Rainbow Paintbrush. I’m sure there’ll be many games announced that I’d like to play, but I’m contempt to play them in the far future. And, despite being largely unemployed right now, I just don’t have the will to play through things as much as I used to.</p>\n",date:"2017-06-07T00:00:00.000Z",timeToRead:1}},{node:{title:"Public Speaking",path:"/blog/2017/05/30/public-speaking",excerpt:"<p>In my effort to gain human contact, last month I attended the monthly meetup for the Humanist Society of New Zealand. I was apprehensive at first, but it ended up being very enjoyable. I got to have great conversations with intelligent people.</p>\n",date:"2017-05-30T00:00:00.000Z",timeToRead:1}},{node:{title:"Today",path:"/blog/2017/05/25/today",excerpt:"<p>I feel violently awful today and I don’t know why.</p>\n",date:"2017-05-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Times They Are Changing",path:"/blog/2017/05/24/times-they-are-changing",excerpt:"<p>Things generally devalue with age.</p>\n",date:"2017-05-24T00:00:00.000Z",timeToRead:3}},{node:{title:"I have done",path:"/blog/2017/05/21/i-have-done",excerpt:"<p>For a few years I was into a technology culture that is still growing now – the amateur maker scene. A few fortunate events let me turn this into commissioned work.</p>\n",date:"2017-05-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I eat",path:"/blog/2017/05/19/i-eat",excerpt:"<p>For a while now I’ve just been skipping meals. When high noon or the evening rolls around I just lack motivation to prepare anything worth eating. Cheap things you can buy ready made are always full of salt and fat. Takeaways in this small town are limited to the main burger chains or a giant deep fried smorgasbord.</p>\n",date:"2017-05-19T00:00:00.000Z",timeToRead:2}},{node:{title:"Suicide",path:"/blog/2017/05/02/suicide",excerpt:"<p>This is a tough subject, a strong taboo in society. But after watching 13 Reason Why I feel urged to write about my perspective on suicide. I found the show very compelling, the writing is excellent and the characters are very well realised. But the road to taking ones own life can take many forms.</p>\n",date:"2017-05-02T00:00:00.000Z",timeToRead:2}},{node:{title:"A Red Jacket",path:"/blog/2017/04/28/a-red-jacket",excerpt:"<p>Ugh.</p>\n",date:"2017-04-28T00:00:00.000Z",timeToRead:2}}]}}}}}]);